import React, { Component } from 'react';
import {Block, List, ListInput} from 'framework7-react'

class DataPage extends Component {

  render() {
    return (
      <div>
      <BlockTitle>Your params</BlockTitle>
      <List inset>
        <ListInput
          label="Name 1"
          type="text"
          placeholder="Your name"
          clearButton
        />
        <ListInput
          label="2 Something else"
          type="text"
          placeholder="Not name"
          clearButton
        />
      </List>
    </div>
    );
  }

}

export default DataPage;
